INSERT INTO `Event` (`id`, `title`, `description`, `path_image`, `created_at`, `user_id`) VALUES (1, 'Bersama Bumi Sehat Malang: Aksi Gotong Royong Bersihkan Sampah demi Negeri Hijau', 'Mengundang seluruh warga Malang untuk berpartisipasi dalam event luar biasa ini! Temukan kekuatan solidaritas dan kesatuan di dalam hati kita saat kita bersama-sama membersihkan dan menyucikan kota ini. \"Bersama Bumi Sehat Malang\" adalah panggilan untuk beraksi, gotong royong, dan menyumbangkan waktu untuk menciptakan kota yang lebih hijau dan bersih. Bersama-sama, kita buang sampah, bersihkan lingkungan, dan tingkatkan kualitas hidup kita. Mari jadikan Malang tempat yang kita cintai, tempat yang indah untuk generasi mendatang! Ayo bergabung dalam pergerakan sosial ini dan berikan kontribusi nyata untuk menjaga bumi kita bersama-sama. Jam 10.00', 'https://awsimages.detik.net.id/community/media/visual/2023/09/07/sampah-di-sungai-bunulrejo-malang-dipenuhi-sampah_169.jpeg?w=1200', '2023-12-11 13:28:53', '784cb972-734d-4461-9d15-34ddac8c4a6d');
INSERT INTO `Event` (`id`, `title`, `description`, `path_image`, `created_at`, `user_id`) VALUES (2, 'Gotong Royong Kota Malang: Bersihkan Sampah, Bangun Solidaritas!', 'Warga Malang yang tercinta, saatnya untuk bergerak bersama dalam aksi gotong royong! Kami mengundang Anda untuk turut serta membersihkan sampah di sekitar kita dan memperkuat ikatan sosial. Jangan lewatkan momen berharga ini yang akan datang dalam beberapa minggu ke depan. Pastikan Anda menyisihkan waktu untuk bergabung dan berkontribusi dalam membangun kota yang lebih baik. Informasi lebih lanjut segera menyusul. Ayo, persiapkan diri Anda untuk gotong royong yang penuh makna!', 'https://thumb.viva.id/vivamalang/1265x711/2023/08/29/64ed9a60b625c-tps3r-di-kelurahan-dadaprejo-kota-batu_malang.jpg', '2023-12-12 03:42:17', '784cb972-734d-4461-9d15-34ddac8c4a6d');
INSERT INTO `Event` (`id`, `title`, `description`, `path_image`, `created_at`, `user_id`) VALUES (3, 'Aksi Gotong Royong Lingkungan: Warga Malang, Mari Jaga Bersama!', 'Kepada seluruh warga Malang, mari jaga bersama lingkungan kita dalam aksi gotong royong yang akan datang. Bersiaplah untuk bergabung dalam kegiatan pembersihan dan penataan lingkungan yang akan diumumkan beberapa minggu mendatang. Jadilah bagian dari perubahan positif untuk masa depan kota ini. Sediakan waktu Anda dan ajaklah keluarga serta tetangga untuk bergabung. Bersama, kita bisa menciptakan lingkungan yang lebih baik untuk generasi mendatang. Pantau informasi selanjutnya!\r\n\r\n\r\n\r\n\r\n\r\nKepada seluruh warga Malang, mari jaga bersama lingkungan kita dalam aksi gotong royong yang akan datang. Bersiaplah untuk bergabung dalam kegiatan pembersihan dan penataan lingkungan yang akan diumumkan beberapa minggu mendatang. Jadilah bagian dari perubahan positif untuk masa depan kota ini. Sediakan waktu Anda dan ajaklah keluarga serta tetangga untuk bergabung. Bersama, kita bisa menciptakan lingkungan yang lebih baik untuk generasi mendatang. Pantau informasi selanjutnya!\r\n\r\n\r\n\r\n\r\n\r\nKepada seluruh warga Malang, mari jaga bersama lingkungan kita dalam aksi gotong royong yang akan datang. Bersiaplah untuk bergabung dalam kegiatan pembersihan dan penataan lingkungan yang akan diumumkan beberapa minggu mendatang. Jadilah bagian dari perubahan positif untuk masa depan kota ini. Sediakan waktu Anda dan ajaklah keluarga serta tetangga untuk bergabung. Bersama, kita bisa menciptakan lingkungan yang lebih baik untuk generasi mendatang. Pantau informasi selanjutnya.', 'https://asset.kompas.com/crops/TBwJyVHnDLvnW4OsJq3Nwyp3qAM=/0x0:0x0/780x390/data/photo/2022/04/18/625d19896d235.jpg', '2023-12-12 03:42:23', '784cb972-734d-4461-9d15-34ddac8c4a6d');
